import React, {Component} from 'react'
import { Rating } from 'semantic-ui-react'

class Profile extends Component {

	componentDidMount() {
		console.log(this.props.user)
	}

	render() {
		return (
			<div className="ui container divided relaxed two column grid">
				<div className="ui divided items">
					<div className="item">
						<div className="ui avatar circular image"><img src="/images/wireframe/image.png"/></div>
						<div className="content"><div className="header">{this.props.user.username}</div>
							<div className="meta"><span>Date</span><span>Category</span></div>
							<Rating defaultRating={this.props.user.plant_care_rating} maxRating={5} disabled />
						</div>
					</div>
				</div>
			</div>
		)
	}
}

export default Profile
